import React, { useEffect } from 'react';
// Theme
import "./theme/theme.scss";

// Routes
import { Router, Route, Switch, Redirect, useHistory } from "react-router-dom";
import routesContainer from "./routes/routesContainer";
import history from "./routes/history";

import Login from './pages/auth/Login';
import { useAppSelector } from './redux/hooks';
import { selectAuthState } from './pages/auth/authSlice';   

const App = () => {
  // const historyHook = useHistory();
  const authState = useAppSelector(selectAuthState);
  alert(authState.authenticated)
  return (
    <Router history={history}>
      <Switch>
          {!authState.authenticated ? <Route path="/" exact component={Login} /> : null}
          <Route path="/" component={routesContainer} /> 
      </Switch>
    </Router>
  );
}

export default App;
